import React, { useEffect, useContext, useState } from "react";
import { PetsContext } from "../../App";
import { Container, PetsCard, FilterRow } from "./styles";
import { Input } from "antd";

export default function HomePage() {
  const { pets = [], getPets } = useContext(PetsContext);
  const [filter, setfilter] = useState({});

  useEffect(() => {
    getPets();
  }, []);

  // getPets(null, { breed: "peter" });

  return (
    <Container>
      <FilterRow>
        <Input placeholder="breed"></Input>
        <Input placeholder="location"></Input>
        <Input placeholder="minAge"></Input>
        <Input placeholder="maxAge"></Input>
      </FilterRow>
      {pets.map((e) => {
        return (
          <PetsCard key={e.id}>
            <p>name : {e.name}</p>
            <p>age : {e.age}</p>
            <p>location : {e.location}</p>
            <p>breed : {e.breed}</p>
          </PetsCard>
        );
      })}
    </Container>
  );
}
